import React from "react";

const Home = () => {
  return (
    <div>
      <p>this works!</p>
      <iframe
        title="spotify"
        src="https://open.spotify.com/embed/playlist/62W2MjEoHtmobGgcaMurP9"
        width="300"
        height="380"
        frameborder="0"
        allowtransparency="true"
        allow="encrypted-media"
      ></iframe>
    </div>
  );
};

export default Home;
